import React, { Component } from 'react';
import './App.css';
import ReactDOM from 'react-dom';
import Button from '@material-ui/core/Button';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>Hello Leda I LOVE U!</h1>

        <table>
        <tr>
          <th>Name</th>
        </tr>
        <tr>
          <td>John</td>
        </tr>
        <tr>
          <td>Elsa</td>
        </tr>
      </table>

      <Button variant="contained" color="primary">
      Hello World
      </Button>

      </div>




    );



  }
}

export default App;
